<!DOCTYPE html>
<html>
  <head>
    <title>Home</title>
    <meta http-equiv="X-UA-Compatible" content="IE=edge"/>
    <meta http-equiv="content-type" content="text/html; charset=utf-8"/>
    <meta name="apple-mobile-web-app-capable" content="yes"/>
    <link href="resources/css/jquery-ui-themes.css" type="text/css" rel="stylesheet"/>
    <link href="resources/css/axure_rp_page.css" type="text/css" rel="stylesheet"/>
    <link href="data/styles.css" type="text/css" rel="stylesheet"/>
    <link href="files/home/styles.css" type="text/css" rel="stylesheet"/>
    <script src="resources/scripts/jquery-1.7.1.min.js"></script>
    <script src="resources/scripts/jquery-ui-1.8.10.custom.min.js"></script>
    <script src="resources/scripts/prototypePre.js"></script>
    <script src="data/document.js"></script>
    <script src="resources/scripts/prototypePost.js"></script>
    <script src="files/home/data.js"></script>
    <script type="text/javascript">
      $axure.utils.getTransparentGifPath = function() { return 'resources/images/transparent.gif'; };
      $axure.utils.getOtherPath = function() { return 'resources/Other.html'; };
      $axure.utils.getReloadPath = function() { return 'resources/reload.html'; };
    </script>
  </head>
  <body>
    <div id="base" class="">

      <!-- Unnamed (Image) -->
      <div id="u0" class="ax_default image">
        <img id="u0_img" class="img " src="images/home/u0.png"/>
      </div>

      <!-- Log in (Rectangle) -->
      <div id="u1" class="ax_default button" data-label="Log in">
        <div id="u1_div" class=""></div>
        <div id="u1_text" class="text ">
          <p><span>Log in</span></p>
        </div>
      </div>

      <!-- Join us (Rectangle) -->
      <div id="u2" class="ax_default button" data-label="Join us">
        <div id="u2_div" class=""></div>
        <div id="u2_text" class="text ">
          <p><span>Join Us</span></p>
        </div>
      </div>

      <!-- user name1 (Text Field) -->
      <div id="u3" class="ax_default text_field" data-label="user name1">
        <input id="u3_input" type="text" value="user name"/>
      </div>

      <!-- password1 (Text Field) -->
      <div id="u4" class="ax_default text_field" data-label="password1">
        <input id="u4_input" type="text" value="password" disabled/>
      </div>

      <!-- Unnamed (Rectangle) -->
      <div id="u5" class="ax_default link_button">
        <div id="u5_div" class=""></div>
        <div id="u5_text" class="text ">
          <p><span>Previous Step</span></p>
        </div>
      </div>

      <!-- user name2 (Text Field) -->
      <div id="u6" class="ax_default text_field" data-label="user name2">
        <input id="u6_input" type="text" value="user name"/>
      </div>

      <!-- password2 (Text Field) -->
      <div id="u7" class="ax_default text_field" data-label="password2">
        <input id="u7_input" type="text" value="password"/>
      </div>

      <!-- Log in (Rectangle) -->
      <div id="u8" class="ax_default button" data-label="Log in">
        <div id="u8_div" class=""></div>
        <div id="u8_text" class="text ">
          <p><span>Log in</span></p>
        </div>
      </div>

      <!-- error (Rectangle) -->
      <div id="u9" class="ax_default label ax_default_hidden disabled" data-label="error" style="display:none; visibility: hidden">
        <div id="u9_div" class="disabled"></div>
        <div id="u9_text" class="text ">
          <p><span>Wrong user name or password</span></p>
        </div>
      </div>

      <!-- Unnamed (Rectangle) -->
      <div id="u10" class="ax_default label ax_default_hidden" style="display:none; visibility: hidden">
        <div id="u10_div" class=""></div>
        <div id="u10_text" class="text ">
          <p><span>Wrong user name or password</span></p>
        </div>
      </div>
    </div>
  </body>
</html>
